import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";

import Header from "./Header";

function Login() {
    useEffect(() => {
      if (localStorage.getItem("user-info")) {
        navigate("/add");
      }
    }, []);
    
  return (
    <div>
      <Header />
      <h1>Login page</h1>
    </div>
  );
}

export default Login;
